if mibBuilder.loadTexts: ipivcDnaCugPrivileged.setDescription('This attribute, if set to a value of yes indicates that this CUG is a privileged CUG. In DPN, at least one side of a call setup within a CUG must have the CUG as a privileged CUG. If set to a value of no, then the CUG is not privileged. If both the local DTE and the remote DTE subscribe to the CUG, but it is not privileged, then the call will be cleared. This attribute is typically used for a host DTE which must accept calls from many other DTEs in which case the other DTEs cannot call one another, but can call the host. In this example, the host would have the privileged CUG, and the other DTEs would belong to the same CUG, but it would not be privileged.')
