if mibBuilder.loadTexts: ipivcLcnVcStatsTable.setDescription('*** THIS TABLE CURRENTLY NOT IMPLEMENTED *** ... Statistics(Stats) This group defines general attributes collected by general Vc. The purpose of Vc attributes is to aid end users and verification people to understand the Vc internal behavior. This is particularly useful when the network has experienced abnormality and we want to isolate problems and pinpoint trouble spots. Attributes are collected on a per Vc basis. Until a need is identified, statistics are not collected at a processor level. Each attribute is stored in a 32 bit field and is initialized to zero when a Vc enters into the data transfer state. When a PVC is disconnected and then connected again, the attributes will be reset. Attributes cannot be reset through other methods.')
ipivcLcnVcStatsEntry = MibTableRow((1, 3, 6, 1, 4, 1, 562, 2, 4, 1, 51, 4, 2, 12, 1), ).setIndexNames((0, "Nortel-Magellan-Passport-IpiVcMIB", "ipivcIndex"), (0, "Nortel-Magellan-Passport-IpiVcMIB", "ipivcLcnIndex"), (0, "Nortel-Magellan-Passport-IpiVcMIB", "ipivcLcnVcIndex"))
if mibBuilder.loadTexts: ipivcLcnVcStatsEntry.setStatus('mandatory')
